import React from "react";
import Card from "../Card";
import Query from "../../components/Query";
import articles from "../../components/Card";

const Articles = ({ articles }) => {
  return (
    <div class="container">
      <div class="row">
        <div class="col-md-8">
          <Query query={ARTICLES_QUERY}>
            {({ data: { articles } }) => {
              const imageUrl =
                process.env.NODE_ENV !== "development"
                  ? articles.image.url
                  : process.env.REACT_APP_BACKEND_URL + articles.image.url;
              return (
                <div class="card mb-4">
                  <div class="card-body">
                    <h2 class="card-title">{articles.title}</h2>
                    <img
                      src={imageUrl}
                      alt={articles.image.url}
                      height="100"
                    />
                    <p>{articles.slug}</p>  
                  </div>
                </div>
              );
            }}
          </Query>
        </div>
      </div>
    </div>
  );
};

export default Articles;
